import './webService.scss';
import { useState } from 'react';
import PcWindow from '../pcWindow/pcWindow';
import Gear from '../gear/gear';

const WebService = (): JSX.Element => {

    const gear = <div className="gearWrapper"><Gear classNameAdded=""/></div>

    return (
        <div className="webService">
            <div className="webService__windowWrapper">
                <PcWindow elements={gear}/>
            </div>
            <div className="webService__textWrapper">
                <span>Do you need help with builidng your webshop?</span>
            </div>
        </div>
    );
}

export default WebService;
